export const getEvents = (location) => {
    var myHeaders = new Headers();
    myHeaders.append("Access-Control-Allow-Origin", "http://192.168.0.3:3000");
    return fetch("http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2&location=paris", {
        method: "GET",
        headers: myHeaders,
        mode: "cors",
        credentials: "omit"
    }).then((res) => {
        return res;
    }).catch((err) => {
        console.log(err);
    });
}
